import { paginationReducer } from '@material-ui/data-grid';
import React from 'react'

 export const Pagination = ({usersPerPage, totalUsers, paginate}) => {
    const pageNumbers = [];

    for (let i = 1; i <= Math.ceil(totalUsers / usersPerPage); i++){
        pageNumbers.push(i);
    }
    return (

            <nav className="relative z-0 inline-flex shadow-sm">
                {pageNumbers.map(number => (                  
                    <a key={number} onClick={() => paginate(number)} href="!#" className="-ml-px relative inline-flex items-center px-4 py-2 border border-gray-300 bg-white text-sm leading-5 font-medium text-gray-700 hover:text-gray-500 focus:z-10 focus:outline-none focus:border-blue-300 focus:shadow-outline-blue active:bg-gray-100 active:text-gray-700 transition ease-in-out duration-150">{number}</a>
                ))}
                </nav>

    )
}

export default Pagination;
